import React from 'react';

const Menu = () => {
  return (
  <div className="checkList">
    <div className="title">Your CheckList:</div>
    <div className="list-container">
      {checkList.map((item, index) => (
         <div key={index}>
           <span>{item}</span>
         </div>
      ))}
    </div>
  </div>
);
};
  export default Menu;
